import { FormControl, NativeSelect, StylesProvider } from '@material-ui/core';
import styles from './CountyPicker.module.css'

const CountryPicker = () => {

    return (
        <FormControl className={StylesProvider.container} >
            <NativeSelect>
                <option value="global">Global</option>
            </NativeSelect>
        </FormControl >
    );

}
export default CountryPicker;
